[printer]
kinematics: corexy
max_velocity: 700            
max_accel: 25000 #40000             
minimum_cruise_ratio: 0.35 #0.25
max_z_velocity: 20 #10
max_z_accel: 500
square_corner_velocity: 5.0  

[lis2dw]
cs_pin: extra_mcu:PB12
spi_software_sclk_pin: extra_mcu:PB13
spi_software_mosi_pin: extra_mcu:PB15
spi_software_miso_pin: extra_mcu:PB14
axes_map: x,z,y

[resonance_tester]
accel_chip: lis2dw
probe_points:
    256.5, 253, 30
#    250, 250, 30  
accel_per_hz: 50
min_freq: 15
max_freq: 100
max_smoothing: 0.5
hz_per_sec: 0.5

[input_shaper]
shaper_type_x: mzv
shaper_freq_x: 49.8
shaper_type_y: mzv
shaper_freq_y: 35.8
damping_ratio_x: 0.0330
damping_ratio_y: 0.0473

[probe_eddy_current eddy]
sensor_type: ldc1612
z_offset: 3.5
i2c_mcu: extra_mcu
i2c_bus: i2c2
x_offset: -19.8
y_offset: -0.75
vir_contact_speed: 3.0
speed: 3.0
lift_speed: 20

[bed_mesh]
speed: 400
horizontal_move_z: 1.5
algorithm: bicubic 
mesh_min: 13,15              
mesh_max: 476,490
probe_count: 60,60
fade_start: 0.6
fade_end: 10
scan_overshoot: 4

[z_offset_calibration]
non_contact_probe:probe_eddy_current eddy
contact_probe:probe_eddy_current eddy
endstop_xy_position: 250,251                        
z_hop: 5                       
z_hop_speed: 10
internal_endstop_offset: -0.25  

[quad_gantry_level]          
gantry_corners:              
	-70,-40
	550,600
points:
    50, 30
    50, 470
    490, 470
    490, 30
speed: 400                   
horizontal_move_z: 15
retry_tolerance: 0.075
retries: 15                  
max_adjust: 20

[homing_override]
gcode:
   {% if not 'Z' in params and not 'Y' in params and 'X' in params %}
     {% if printer.toolhead.homed_axes != "xyz" %}
       G90
       G0 Z5 F300
     {% endif %}
     M9928 X
   {% elif not 'Z' in params and not 'X' in params and 'Y' in params %}
     {% if printer.toolhead.homed_axes != "xyz" %}
       G90
       G0 Z5 F300
     {% endif %}
     M9928 Y
   {% elif not 'Z' in params and 'X' in params and 'Y' in params %}
     {% if printer.toolhead.homed_axes != "xyz" %}
       G90
       G0 Z5 F300
     {% endif %}
